package com.javaex.practice01;

public class problem04 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for( int a =1; a<=10; a++) {
			for(int b =0;b<=9;b++ ) {
				System.out.print((a+b));
				System.out.print(" ");
			}
			System.out.println();
		}
}
}
	

